import React from "react";
import Button from "@material-ui/core/Button";

function LessonCreator() {
  return (
    <>
      <div className="create-lesson">
        <Button variant="contained" color="primary">
          Add New Lesson
        </Button>
      </div>
    </>
  );
}

export default LessonCreator;
